ALLOWED_WORDS["hebrew,15"] = ["\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05d8\u05d5\u05e8\u05d9\u05d5\u05ea", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d9\u05ea\u05db\u05dd", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d9\u05ea\u05db\u05df", "\u05d0\u05d3\u05de\u05d9\u05e0\u05d9\u05e1\u05d8\u05e8\u05e6\u05d9\u05d9\u05ea\u05e0\u05d5", "\u05d0\u05d5\u05d8\u05d5\u05d0\u05de\u05e0\u05e6\u05d9\u05e4\u05e6\u05d9\u05d9\u05ea\u05d4", "\u05d0\u05d5\u05d8\u05d5\u05d0\u05de\u05e0\u05e6\u05d9\u05e4\u05e6\u05d9\u05d9\u05ea\u05d5", "\u05d0\u05d5\u05d8\u05d5\u05d0\u05de\u05e0\u05e6\u05d9\u05e4\u05e6\u05d9\u05d9\u05ea\u05d9", "\u05d0\u05d5\u05d8\u05d5\u05d0\u05de\u05e0\u05e6\u05d9\u05e4\u05e6\u05d9\u05d9\u05ea\u05da", "\u05d0\u05d5\u05d8\u05d5\u05d0\u05de\u05e0\u05e6\u05d9\u05e4\u05e6\u05d9\u05d9\u05ea\u05dd", "\u05d0\u05d5\u05d8\u05d5\u05d0\u05de\u05e0\u05e6\u05d9\u05e4\u05e6\u05d9\u05d9\u05ea\u05df", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d9\u05ea\u05db\u05dd", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d9\u05ea\u05db\u05df", "\u05d0\u05d5\u05d8\u05d5\u05d1\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d9\u05ea\u05e0\u05d5", "\u05d0\u05d5\u05de\u05e0\u05d9\u05e4\u05d5\u05d8\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d0\u05d5\u05de\u05e0\u05d9\u05e4\u05d5\u05d8\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05df", "\u05d0\u05d5\u05de\u05e0\u05d9\u05e4\u05d5\u05d8\u05e0\u05d8\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d0\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d0\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d0\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d0\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d0\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05d0\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05d5\u05e4\u05d8\u05d9\u05de\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d5\u05e4\u05d8\u05d9\u05de\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d5\u05e4\u05d8\u05d9\u05de\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d5\u05e4\u05d8\u05d9\u05de\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d5\u05e4\u05d8\u05d9\u05de\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d5\u05e4\u05d8\u05d9\u05de\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05d5\u05e8\u05ea\u05d5\u05d3\u05d5\u05e7\u05e1\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d5\u05e8\u05ea\u05d5\u05d3\u05d5\u05e7\u05e1\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d5\u05e8\u05ea\u05d5\u05d3\u05d5\u05e7\u05e1\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d5\u05e8\u05ea\u05d5\u05d3\u05d5\u05e7\u05e1\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d5\u05e8\u05ea\u05d5\u05d3\u05d5\u05e7\u05e1\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d5\u05e8\u05ea\u05d5\u05d3\u05d5\u05e7\u05e1\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05d9\u05de\u05d5\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d9\u05de\u05d5\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d9\u05de\u05d5\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d9\u05de\u05d5\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d9\u05de\u05d5\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d9\u05de\u05d5\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d9\u05ea\u05db\u05dd", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d9\u05ea\u05db\u05df", "\u05d0\u05d9\u05de\u05e4\u05e8\u05d5\u05d1\u05d9\u05d6\u05e6\u05d9\u05d9\u05ea\u05e0\u05d5", "\u05d0\u05d9\u05e0\u05d3\u05d5\u05e7\u05d8\u05e8\u05d9\u05e0\u05e6\u05d9\u05d9\u05ea\u05d4", "\u05d0\u05d9\u05e0\u05d3\u05d5\u05e7\u05d8\u05e8\u05d9\u05e0\u05e6\u05d9\u05d9\u05ea\u05d5", "\u05d0\u05d9\u05e0\u05d3\u05d5\u05e7\u05d8\u05e8\u05d9\u05e0\u05e6\u05d9\u05d9\u05ea\u05d9", "\u05d0\u05d9\u05e0\u05d3\u05d5\u05e7\u05d8\u05e8\u05d9\u05e0\u05e6\u05d9\u05d9\u05ea\u05da", "\u05d0\u05d9\u05e0\u05d3\u05d5\u05e7\u05d8\u05e8\u05d9\u05e0\u05e6\u05d9\u05d9\u05ea\u05dd", "\u05d0\u05d9\u05e0\u05d3\u05d5\u05e7\u05d8\u05e8\u05d9\u05e0\u05e6\u05d9\u05d9\u05ea\u05df", "\u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05d5\u05de\u05d9\u05d4\u05dd", "\u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05d5\u05de\u05d9\u05d4\u05df", "\u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05d5\u05de\u05d9\u05d9\u05da", "\u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05d5\u05de\u05d9\u05db\u05dd", "\u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05d5\u05de\u05d9\u05db\u05df", "\u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05d5\u05de\u05d9\u05e0\u05d5", "\u05d0\u05d9\u05e0\u05d8\u05dc\u05d9\u05d2\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05dc\u05d9\u05d2\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d9\u05e0\u05d8\u05dc\u05d9\u05d2\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d9\u05e0\u05d8\u05dc\u05d9\u05d2\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05dc\u05d9\u05d2\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d9\u05e0\u05d8\u05dc\u05d9\u05d2\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05d0\u05e7\u05d8\u05d9\u05d1\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05d0\u05e7\u05d8\u05d9\u05d1\u05d9\u05d5\u05ea\u05db\u05df", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05d0\u05e7\u05d8\u05d9\u05d1\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05e8\u05d8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05e8\u05d8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05e8\u05d8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05e8\u05d8\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05e8\u05d8\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05d9\u05e0\u05d8\u05e8\u05e4\u05e8\u05d8\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05de\u05d2\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05de\u05d2\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05df", "\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05de\u05d2\u05e0\u05d8\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d0\u05e0\u05e6\u05d9\u05e7\u05dc\u05d5\u05e4\u05d3\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05e0\u05e6\u05d9\u05e7\u05dc\u05d5\u05e4\u05d3\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05e0\u05e6\u05d9\u05e7\u05dc\u05d5\u05e4\u05d3\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05e0\u05e6\u05d9\u05e7\u05dc\u05d5\u05e4\u05d3\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05e0\u05e6\u05d9\u05e7\u05dc\u05d5\u05e4\u05d3\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05e0\u05e6\u05d9\u05e7\u05dc\u05d5\u05e4\u05d3\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05e0\u05ea\u05e8\u05d5\u05e4\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d0\u05e0\u05ea\u05e8\u05d5\u05e4\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d0\u05e0\u05ea\u05e8\u05d5\u05e4\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d0\u05e0\u05ea\u05e8\u05d5\u05e4\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e0\u05d0\u05d5\u05d8\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e0\u05d0\u05d5\u05d8\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e0\u05d0\u05d5\u05d8\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e0\u05d0\u05d5\u05d8\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e0\u05d0\u05d5\u05d8\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e0\u05d0\u05d5\u05d8\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e4\u05d9\u05d6\u05d9\u05e7\u05d0\u05d9\u05ea\u05db\u05dd", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e4\u05d9\u05d6\u05d9\u05e7\u05d0\u05d9\u05ea\u05db\u05df", "\u05d0\u05e1\u05d8\u05e8\u05d5\u05e4\u05d9\u05d6\u05d9\u05e7\u05d0\u05d9\u05ea\u05e0\u05d5", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05e4\u05d5\u05d8\u05e8\u05d5\u05e4\u05d5\u05e1\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05e4\u05d9\u05d3\u05de\u05d9\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d0\u05e4\u05d9\u05d3\u05de\u05d9\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d0\u05e4\u05d9\u05d3\u05de\u05d9\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d0\u05e4\u05d9\u05d3\u05de\u05d9\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d0\u05e7\u05d5\u05d5\u05d9\u05d5\u05d5\u05dc\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d0\u05e7\u05d5\u05d5\u05d9\u05d5\u05d5\u05dc\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05df", "\u05d0\u05e7\u05d5\u05d5\u05d9\u05d5\u05d5\u05dc\u05e0\u05d8\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d0\u05e7\u05e1\u05d4\u05d9\u05d1\u05d9\u05e6\u05d9\u05d5\u05e0\u05d9\u05e1\u05d8\u05d9", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05d5\u05d5\u05d2\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05d5\u05d5\u05d2\u05e0\u05d8\u05d9\u05d5\u05ea\u05db\u05df", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05d5\u05d5\u05d2\u05e0\u05d8\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05e7\u05e1\u05d8\u05e8\u05e4\u05d5\u05dc\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05e8\u05d9\u05e1\u05d8\u05d5\u05e7\u05e8\u05d8\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d0\u05e8\u05d9\u05e1\u05d8\u05d5\u05e7\u05e8\u05d8\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d0\u05e8\u05d9\u05e1\u05d8\u05d5\u05e7\u05e8\u05d8\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d0\u05e8\u05d9\u05e1\u05d8\u05d5\u05e7\u05e8\u05d8\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d0\u05e8\u05d9\u05e1\u05d8\u05d5\u05e7\u05e8\u05d8\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d0\u05e8\u05d9\u05e1\u05d8\u05d5\u05e7\u05e8\u05d8\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d0\u05e8\u05db\u05d9\u05d1\u05d9\u05e9\u05d5\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d0\u05e8\u05db\u05d9\u05d1\u05d9\u05e9\u05d5\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d0\u05e8\u05db\u05d9\u05d1\u05d9\u05e9\u05d5\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d0\u05e8\u05db\u05d9\u05d1\u05d9\u05e9\u05d5\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d1\u05d9\u05d1\u05dc\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d1\u05d9\u05d1\u05dc\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d1\u05d9\u05d1\u05dc\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d1\u05d9\u05d1\u05dc\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d1\u05d9\u05d1\u05dc\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d1\u05d9\u05d1\u05dc\u05d9\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d3\u05d9\u05e1\u05d0\u05d9\u05e0\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d9\u05ea\u05d4", "\u05d3\u05d9\u05e1\u05d0\u05d9\u05e0\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d9\u05ea\u05d5", "\u05d3\u05d9\u05e1\u05d0\u05d9\u05e0\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d9\u05ea\u05d9", "\u05d3\u05d9\u05e1\u05d0\u05d9\u05e0\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d9\u05ea\u05da", "\u05d3\u05d9\u05e1\u05d0\u05d9\u05e0\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d9\u05ea\u05dd", "\u05d3\u05d9\u05e1\u05d0\u05d9\u05e0\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d9\u05ea\u05df", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05e0\u05d9\u05d9", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05e0\u05d9\u05ea", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d9\u05ea\u05db\u05dd", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d9\u05ea\u05db\u05df", "\u05d3\u05d9\u05e1\u05e4\u05e8\u05d5\u05e4\u05d5\u05e8\u05e6\u05d9\u05d9\u05ea\u05e0\u05d5", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05da", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d9\u05ea\u05db\u05dd", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d9\u05ea\u05db\u05df", "\u05d3\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d9\u05ea\u05e0\u05d5", "\u05d4\u05d5\u05de\u05d5\u05e1\u05e7\u05e1\u05d5\u05d0\u05dc\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d4\u05d5\u05de\u05d5\u05e1\u05e7\u05e1\u05d5\u05d0\u05dc\u05d9\u05d5\u05ea\u05db\u05df", "\u05d4\u05d5\u05de\u05d5\u05e1\u05e7\u05e1\u05d5\u05d0\u05dc\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d4\u05d8\u05e8\u05d5\u05e1\u05e7\u05e1\u05d5\u05d0\u05dc\u05d9\u05d5\u05ea\u05db\u05dd", "\u05d4\u05d8\u05e8\u05d5\u05e1\u05e7\u05e1\u05d5\u05d0\u05dc\u05d9\u05d5\u05ea\u05db\u05df", "\u05d4\u05d8\u05e8\u05d5\u05e1\u05e7\u05e1\u05d5\u05d0\u05dc\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d4\u05ea\u05d9\u05d9\u05e4\u05d9\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d4\u05ea\u05d9\u05d9\u05e4\u05d9\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d4\u05ea\u05d9\u05d9\u05e4\u05d9\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d4\u05ea\u05d9\u05d9\u05e4\u05d9\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d4\u05ea\u05d9\u05d9\u05e4\u05d9\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d4\u05ea\u05d9\u05d9\u05e4\u05d9\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d8\u05e8\u05d9\u05d8\u05d5\u05e8\u05d9\u05d0\u05dc\u05d9\u05e1\u05d8\u05d9\u05d9\u05dd", "\u05d8\u05e8\u05de\u05d9\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d8\u05e8\u05de\u05d9\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d8\u05e8\u05de\u05d9\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d8\u05e8\u05de\u05d9\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d8\u05e8\u05de\u05d9\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d8\u05e8\u05de\u05d9\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05d8\u05e8\u05e0\u05e1\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05d8\u05e8\u05e0\u05e1\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05d8\u05e8\u05e0\u05e1\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05d8\u05e8\u05e0\u05e1\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05d8\u05e8\u05e0\u05e1\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05d8\u05e8\u05e0\u05e1\u05e4\u05d5\u05e8\u05de\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05de\u05d9\u05e7\u05e8\u05d5\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9\u05d5\u05ea", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e1\u05d8\u05d8\u05d9\u05e1\u05d8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e4\u05d5\u05e0\u05e7\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05e1\u05d8\u05d9\u05d9\u05dd", "\u05e4\u05e8\u05d5\u05d1\u05d9\u05e0\u05e6\u05d9\u05d0\u05dc\u05d9\u05d5\u05ea\u05db\u05dd", "\u05e4\u05e8\u05d5\u05d1\u05d9\u05e0\u05e6\u05d9\u05d0\u05dc\u05d9\u05d5\u05ea\u05db\u05df", "\u05e4\u05e8\u05d5\u05d1\u05d9\u05e0\u05e6\u05d9\u05d0\u05dc\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05e4\u05e8\u05d9\u05de\u05d9\u05d8\u05d9\u05d1\u05d9\u05e1\u05d8\u05d9\u05d9\u05d5\u05ea", "\u05e7\u05d5\u05d0\u05d5\u05e8\u05d3\u05d9\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e7\u05d5\u05d0\u05d5\u05e8\u05d3\u05d9\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e7\u05d5\u05d0\u05d5\u05e8\u05d3\u05d9\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e7\u05d5\u05d0\u05d5\u05e8\u05d3\u05d9\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e7\u05d5\u05d0\u05d5\u05e8\u05d3\u05d9\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e7\u05d5\u05d0\u05d5\u05e8\u05d3\u05d9\u05e0\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e7\u05d5\u05e0\u05d8\u05e8\u05d5\u05d1\u05e8\u05e1\u05dc\u05d9\u05d5\u05ea\u05db\u05dd", "\u05e7\u05d5\u05e0\u05d8\u05e8\u05d5\u05d1\u05e8\u05e1\u05dc\u05d9\u05d5\u05ea\u05db\u05df", "\u05e7\u05d5\u05e0\u05d8\u05e8\u05d5\u05d1\u05e8\u05e1\u05dc\u05d9\u05d5\u05ea\u05e0\u05d5", "\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d3\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d3\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d3\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d3\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d3\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d3\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05d9\u05d8\u05d5\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05d9\u05d8\u05d5\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05d9\u05d8\u05d5\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05d9\u05d8\u05d5\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05d9\u05d8\u05d5\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05d9\u05d8\u05d5\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e7\u05d5\u05e0\u05e1\u05e4\u05d8\u05d5\u05d0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea", "\u05e7\u05d5\u05e0\u05e1\u05e4\u05d8\u05d5\u05d0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d9\u05ea", "\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d4\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d4\u05df", "\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05d9\u05da", "\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05db\u05dd", "\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05db\u05df", "\u05e7\u05d5\u05e0\u05e1\u05e8\u05d1\u05d8\u05d5\u05e8\u05d9\u05d5\u05e0\u05d9\u05e0\u05d5", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05d2\u05e8\u05e4\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e7\u05e8\u05d9\u05e4\u05d8\u05d5\u05dc\u05d5\u05d2\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e8\u05d3\u05d5\u05e7\u05e6\u05d9\u05d5\u05e0\u05d9\u05e1\u05d8\u05d9\u05d9\u05d5\u05ea", "\u05e8\u05d8\u05e8\u05d5\u05e1\u05e4\u05e7\u05d8\u05d9\u05d1\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e8\u05d8\u05e8\u05d5\u05e1\u05e4\u05e7\u05d8\u05d9\u05d1\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e8\u05d8\u05e8\u05d5\u05e1\u05e4\u05e7\u05d8\u05d9\u05d1\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e8\u05d8\u05e8\u05d5\u05e1\u05e4\u05e7\u05d8\u05d9\u05d1\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e8\u05d8\u05e8\u05d5\u05e1\u05e4\u05e7\u05d8\u05d9\u05d1\u05d5\u05ea\u05d9\u05db\u05df", "\u05e8\u05d8\u05e8\u05d5\u05e1\u05e4\u05e7\u05d8\u05d9\u05d1\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05dd", "\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4\u05df", "\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9\u05da", "\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05dd", "\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05db\u05df", "\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d6\u05e6\u05d9\u05d5\u05ea\u05d9\u05e0\u05d5", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d4", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d5", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05d9", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d5\u05ea\u05d9\u05da", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d9\u05ea\u05db\u05dd", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d9\u05ea\u05db\u05df", "\u05e8\u05e7\u05d5\u05e0\u05e1\u05d8\u05e8\u05d5\u05e7\u05e6\u05d9\u05d9\u05ea\u05e0\u05d5"]